#
# TABLE STRUCTURE FOR: Person
#

DROP TABLE IF EXISTS `Person`;

CREATE TABLE `Person` (
  `person_id` int(11) NOT NULL AUTO_INCREMENT,
  `first_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `last_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `password` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `active` BOOLEAN NOT NULL DEFAULT b'0',
  PRIMARY KEY (`person_id`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Client_Admin
#

DROP TABLE IF EXISTS `Client_Admin`;

CREATE TABLE `Client_Admin` (
  `person_id` int(11) NOT NULL,
  PRIMARY KEY (`person_id`),
  CONSTRAINT `Client_Admin_ibfk_1` FOREIGN KEY (`person_id`) REFERENCES `Person` (`person_id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: School
#

DROP TABLE IF EXISTS `School`;

CREATE TABLE `School` (
  `school_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` char(30) COLLATE utf8mb4_unicode_ci NOT NULL,
  `phone_no` varchar(13) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`school_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: School_Rep
#

DROP TABLE IF EXISTS `School_Rep`;

CREATE TABLE `School_Rep` (
  `person_id` int(11) NOT NULL,
  `school_id` int(11) NOT NULL,
  PRIMARY KEY (`person_id`),
  KEY `school_id` (`school_id`),
  CONSTRAINT `School_Rep_ibfk_1` FOREIGN KEY (`person_id`) REFERENCES `Person` (`person_id`),
  CONSTRAINT `School_Rep_ibfk_2` FOREIGN KEY (`school_id`) REFERENCES `School` (`school_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Police_Dept
#

DROP TABLE IF EXISTS `Police_Dept`;

CREATE TABLE `Police_Dept` (
  `police_dept_id` int(11) NOT NULL AUTO_INCREMENT,
  `manager_id` int(11) DEFAULT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`police_dept_id`),
  UNIQUE KEY `name` (`name`),
  KEY `manager_id` (`manager_id`),
  CONSTRAINT `Police_Dept_ibfk_1` FOREIGN KEY (`manager_id`) REFERENCES `Person` (`person_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Highway_Patrol_Officer
#

DROP TABLE IF EXISTS `Highway_Patrol_Officer`;

CREATE TABLE `Highway_Patrol_Officer` (
  `person_id` int(11) NOT NULL,
  `position` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'personel',
  `police_dept_id` int(11) NOT NULL,
  PRIMARY KEY (`person_id`),
  KEY `police_dept_id` (`police_dept_id`),
  CONSTRAINT `Highway_Patrol_Officer_ibfk_1` FOREIGN KEY (`person_id`) REFERENCES `Person` (`person_id`),
  CONSTRAINT `Highway_Patrol_Officer_ibfk_2` FOREIGN KEY (`police_dept_id`) REFERENCES `Police_Dept` (`police_dept_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Municipality
#

DROP TABLE IF EXISTS `Municipality`;

CREATE TABLE `Municipality` (
  `munic_id` int(11) NOT NULL AUTO_INCREMENT,
  `manager_id` int(11) DEFAULT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`munic_id`),
  UNIQUE KEY `name` (`name`),
  KEY `manager_id` (`manager_id`),
  CONSTRAINT `Municipality_ibfk_1` FOREIGN KEY (`manager_id`) REFERENCES `Person` (`person_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Municipal_Officer
#

DROP TABLE IF EXISTS `Municipal_Officer`;

CREATE TABLE `Municipal_Officer` (
  `person_id` int(11) NOT NULL,
  `position` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'personel',
  `munic_id` int(11) NOT NULL,
  PRIMARY KEY (`person_id`),
  KEY `munic_id` (`munic_id`),
  CONSTRAINT `Municipal_Officer_ibfk_1` FOREIGN KEY (`person_id`) REFERENCES `Person` (`person_id`),
  CONSTRAINT `Municipal_Officer_ibfk_2` FOREIGN KEY (`munic_id`) REFERENCES `Municipality` (`munic_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Citation_Type
#

DROP TABLE IF EXISTS `Citation_Type`;

CREATE TABLE `Citation_Type` (
  `citation_type_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `fine` decimal(7,2) NOT NULL,
  `training_eligable` BOOLEAN DEFAULT b'0',
  PRIMARY KEY (`citation_type_id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Course
#

DROP TABLE IF EXISTS `Course`;

CREATE TABLE `Course` (
  `course_id` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `address` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `scheduled` datetime NOT NULL,
  `price` decimal(5,2) NOT NULL,
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `title` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `instructor` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `capacity` int(11) NOT NULL,
  `citation_type_id` int(11) DEFAULT NULL,
  `school_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`course_id`),
  KEY `citation_type_id` (`citation_type_id`),
  KEY `school_id` (`school_id`),
  CONSTRAINT `Course_ibfk_1` FOREIGN KEY (`citation_type_id`) REFERENCES `Citation_Type` (`citation_type_id`),
  CONSTRAINT `Course_ibfk_2` FOREIGN KEY (`school_id`) REFERENCES `School` (`school_id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Insurer
#

DROP TABLE IF EXISTS `Insurer`;

CREATE TABLE `Insurer` (
  `insurer_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`insurer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Citizen
#

DROP TABLE IF EXISTS `Citizen`;

CREATE TABLE `Citizen` (
  `citizen_id` int(11) NOT NULL AUTO_INCREMENT,
  `first_name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `middle_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `last_name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `dob` date NOT NULL,
  `home_address` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `insurer_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`citizen_id`),
  KEY `insurer_id` (`insurer_id`),
  CONSTRAINT `Citizen_ibfk_1` FOREIGN KEY (`insurer_id`) REFERENCES `Insurer` (`insurer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Licence
#

DROP TABLE IF EXISTS `Licence`;

CREATE TABLE `Licence` (
  `licence_id` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `citizen_id` int(11) NOT NULL,
  `expiration_date` date NOT NULL,
  `is_revoked` BOOLEAN NOT NULL DEFAULT b'0',
  `is_suspended` BOOLEAN NOT NULL DEFAULT b'0',
  `licence_class` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`licence_id`,`citizen_id`),
  KEY `citizen_id` (`citizen_id`),
  CONSTRAINT `Licence_ibfk_1` FOREIGN KEY (`citizen_id`) REFERENCES `Citizen` (`citizen_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Citation
#

DROP TABLE IF EXISTS `Citation`;

CREATE TABLE `Citation` (
  `citation_id` int(11) NOT NULL AUTO_INCREMENT,
  `citation_number` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `date_recieved` datetime NOT NULL,
  `citation_type_id` int(11) DEFAULT NULL,
  `officer_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`citation_id`),
  UNIQUE KEY `citation_number` (`citation_number`),
  KEY `officer_id` (`officer_id`),
  KEY `citation_type_id` (`citation_type_id`),
  CONSTRAINT `Citation_ibfk_1` FOREIGN KEY (`officer_id`) REFERENCES `Person` (`person_id`),
  CONSTRAINT `Citation_ibfk_2` FOREIGN KEY (`citation_type_id`) REFERENCES `Citation_Type` (`citation_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Registration
#

DROP TABLE IF EXISTS `Registration`;

CREATE TABLE `Registration` (
  `citizen_id` int(11) NOT NULL,
  `course_id` int(11) NOT NULL,
  `citation_id` int(11) NOT NULL,
  `passed` BOOLEAN NOT NULL DEFAULT b'0',
  PRIMARY KEY (`citizen_id`,`course_id`,`citation_id`),
  KEY `course_id` (`course_id`),
  KEY `citation_id` (`citation_id`),
  CONSTRAINT `Registration_ibfk_1` FOREIGN KEY (`citizen_id`) REFERENCES `Citizen` (`citizen_id`),
  CONSTRAINT `Registration_ibfk_2` FOREIGN KEY (`course_id`) REFERENCES `Course` (`course_id`),
  CONSTRAINT `Registration_ibfk_3` FOREIGN KEY (`citation_id`) REFERENCES `Citation` (`citation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Vehicle
#

DROP TABLE IF EXISTS `Vehicle`;

CREATE TABLE `Vehicle` (
  `vehicle_id` int(11) NOT NULL AUTO_INCREMENT,
  `vin` varchar(30) COLLATE utf8mb4_unicode_ci NOT NULL,
  `name` char(30) COLLATE utf8mb4_unicode_ci NOT NULL,
  `stolen` BOOLEAN NOT NULL DEFAULT b'0',
  `make` char(30) COLLATE utf8mb4_unicode_ci NOT NULL,
  `registered` BOOLEAN NOT NULL DEFAULT b'0',
  `model` char(30) COLLATE utf8mb4_unicode_ci NOT NULL,
  `year_made` smallint(6) NOT NULL,
  `citizen_id` int(11) DEFAULT NULL,
  `insurer_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`vehicle_id`),
  KEY `citizen_id` (`citizen_id`),
  KEY `insurer_id` (`insurer_id`),
  CONSTRAINT `Vehicle_ibfk_1` FOREIGN KEY (`citizen_id`) REFERENCES `Citizen` (`citizen_id`),
  CONSTRAINT `Vehicle_ibfk_2` FOREIGN KEY (`insurer_id`) REFERENCES `Insurer` (`insurer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Vehicle_Record
#

DROP TABLE IF EXISTS `Vehicle_Record`;

CREATE TABLE `Vehicle_Record` (
  `vehicle_id` int(11) NOT NULL,
  `citation_id` int(11) NOT NULL,
  PRIMARY KEY (`vehicle_id`,`citation_id`),
  KEY `citation_id` (`citation_id`),
  CONSTRAINT `Vehicle_Record_ibfk_1` FOREIGN KEY (`citation_id`) REFERENCES `Citation` (`citation_id`),
  CONSTRAINT `Vehicle_Record_ibfk_2` FOREIGN KEY (`vehicle_id`) REFERENCES `Vehicle` (`vehicle_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Driver_Record
#

DROP TABLE IF EXISTS `Driver_Record`;

CREATE TABLE `Driver_Record` (
  `citizen_id` int(11) NOT NULL,
  `citation_id` int(11) NOT NULL,
  PRIMARY KEY (`citizen_id`,`citation_id`),
  KEY `citation_id` (`citation_id`),
  CONSTRAINT `Driver_Record_ibfk_1` FOREIGN KEY (`citation_id`) REFERENCES `Citation` (`citation_id`),
  CONSTRAINT `Driver_Record_ibfk_2` FOREIGN KEY (`citizen_id`) REFERENCES `Citizen` (`citizen_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Licence_Plate
#

DROP TABLE IF EXISTS `Licence_Plate`;

CREATE TABLE `Licence_Plate` (
  `plate_number` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `vehicle_id` int(11) NOT NULL,
  `expired` BOOLEAN NOT NULL DEFAULT b'1',
  PRIMARY KEY (`vehicle_id`,`plate_number`),
  CONSTRAINT `Licence_Plate_ibfk_1` FOREIGN KEY (`vehicle_id`) REFERENCES `Vehicle` (`vehicle_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Payment
#

DROP TABLE IF EXISTS `Payment`;

CREATE TABLE `Payment` (
  `citation_id` int(11) DEFAULT NULL,
  `payment` decimal(7,2) NOT NULL,
  `payment_date` datetime NOT NULL,
  `made_by` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `payment_method` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  KEY `citation_id` (`citation_id`),
  CONSTRAINT `Payment_ibfk_1` FOREIGN KEY (`citation_id`) REFERENCES `Citation` (`citation_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Wanted
#

DROP TABLE IF EXISTS `Wanted`;

CREATE TABLE `Wanted` (
  `wanted_id` int(11) NOT NULL AUTO_INCREMENT,
  `reference_no` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `dangerous` BOOLEAN NOT NULL DEFAULT b'1',
  `crime` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`wanted_id`),
  UNIQUE KEY `reference_no` (`reference_no`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Wanted_Citizen
#

DROP TABLE IF EXISTS `Wanted_Citizen`;

CREATE TABLE `Wanted_Citizen` (
  `citizen_id` int(11) NOT NULL,
  `wanted_id` int(11) NOT NULL,
  PRIMARY KEY (`citizen_id`,`wanted_id`),
  KEY `wanted_id` (`wanted_id`),
  CONSTRAINT `Wanted_Citizen_ibfk_1` FOREIGN KEY (`wanted_id`) REFERENCES `Wanted` (`wanted_id`),
  CONSTRAINT `Wanted_Citizen_ibfk_2` FOREIGN KEY (`citizen_id`) REFERENCES `Citizen` (`citizen_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Wanted_Vehicle
#

DROP TABLE IF EXISTS `Wanted_Vehicle`;

CREATE TABLE `Wanted_Vehicle` (
  `vehicle_id` int(11) NOT NULL,
  `wanted_id` int(11) NOT NULL,
  PRIMARY KEY (`vehicle_id`,`wanted_id`),
  KEY `wanted_id` (`wanted_id`),
  CONSTRAINT `Wanted_Vehicle_ibfk_1` FOREIGN KEY (`vehicle_id`) REFERENCES `Vehicle` (`vehicle_id`),
  CONSTRAINT `Wanted_Vehicle_ibfk_2` FOREIGN KEY (`wanted_id`) REFERENCES `Wanted` (`wanted_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `RefreshToken `;

#Refresh Token Table
CREATE TABLE RefreshToken (
	token_id INT auto_increment NOT NULL PRIMARY KEY,
	person_id INT NOT NULL,
	token VARCHAR(200) NOT NULL,
	expiry_date DATETIME NOT NULL,
	FOREIGN KEY (person_id) REFERENCES Person (person_id)
);

